import React, { useState, useEffect } from "react";
import authService from "../../services/authService";
import VerCurso from "./VerCurso";
import VerHorario from "./VerHorario";
import VerAsignaturas from "./VerAsignaturas";
import MisNotas from "./MisNotas";
import MisResultados from "./MisResultados";
import Asistencia from "./Asistencia";
import Promedios from "./Promedios";
import './estudianteCss/estudiante.css';

const EstudianteDashboard = () => {
    const [user, setUser] = useState(null);
    const [selectedMenu, setSelectedMenu] = useState("");
    const [selectedSubMenu, setSelectedSubMenu] = useState("");

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const userData = await authService.getUserData();
                setUser(userData);
            } catch (error) {
                console.error("Error al obtener datos del usuario:", error);
            }
        };
        fetchUserData();
    }, []);

    const handleMenuClick = (menu) => {
        setSelectedMenu(menu);
        setSelectedSubMenu("");  // Reset sub-menu selection
    };

    const handleSubMenuClick = (subMenu) => {
        setSelectedSubMenu(subMenu);
    };

    if (!user) {
        return <div>Cargando...</div>;
    }

    return (
        <div className="dashboard-container">
            <div className="header">
                <h1>LMS Renca</h1>
                <div>
                    {user && (
                        <div>
                            <span>{user.nombre} {user.apellido}</span>
                            <button onClick={() => authService.logout()}>Cerrar Sesi√≥n</button>
                        </div>
                    )}
                </div>
            </div>
            <div>
                <nav className="nav-bar">
                    <ul>
                        <li><button onClick={() => handleMenuClick("curso")}>Mi Curso</button>
                            {selectedMenu === "curso" && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleSubMenuClick("verCurso")}>Ver Curso</button></li>
                                    <li><button onClick={() => handleSubMenuClick("verHorario")}>Ver Horario</button></li>
                                    <li><button onClick={() => handleSubMenuClick("verAsignaturas")}>Ver Asignaturas</button></li>
                                </ul>
                            )}
                        </li>
                        <li><button onClick={() => handleMenuClick("notas")}>Mis Notas</button></li>
                        <li><button onClick={() => handleMenuClick("resultados")}>Mis Resultados</button>
                            {selectedMenu === "resultados" && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleSubMenuClick("asistencia")}>Asistencia</button></li>
                                    <li><button onClick={() => handleSubMenuClick("promedios")}>Promedio</button></li>
                                </ul>
                            )}
                        </li>
                    </ul>
                </nav>
                <div className="content">
                    {selectedMenu === "curso" && selectedSubMenu === "verCurso" && <VerCurso />}
                    {selectedMenu === "curso" && selectedSubMenu === "verHorario" && <VerHorario />}
                    {selectedMenu === "curso" && selectedSubMenu === "verAsignaturas" && <VerAsignaturas />}
                    {selectedMenu === "notas" && <MisNotas />}
                    {selectedMenu === "resultados" && selectedSubMenu === "asistencia" && <Asistencia />}
                    {selectedMenu === "resultados" && selectedSubMenu === "promedios" && <Promedios />}
                </div>
            </div>
        </div>
    );
};

export default EstudianteDashboard;
